import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { UserService } from '../services/user.service';

@Component({
  selector: 'app-pocetna',
  templateUrl: './pocetna.component.html',
  styleUrls: ['./pocetna.component.css']
})
export class PocetnaComponent {

  constructor(private userService: UserService, private router: Router)
  {

  }
  page: number = 1

  username: string = ""
  password: string = ""
  type: string = ""
  error: string = ""

  // clear all fields that are shared with login/register when switching
  clear()
  {

  }


  login()
  {
    if (this.username == "" || this.password == "")
    {
      this.error = "Unesite sve podatke!";
      return;
    }

    this.userService.login(this.username, this.password).subscribe(data =>{
      if (data)
      {
        this.error = ""
        localStorage.setItem("user", JSON.stringify(data))
        this.router.navigate([data.type]);
      }
      else
      {
        this.error = "Nepostojeci korisnik!"
      }
    })
  }

  forename = ""
  surname = ""
  securityQuestion = ""
  securityAnswer = ""
  sex = ""
  address = ""
  contactPhone = 0
  email = 0
  profilePicure: File = new File([], "empty.txt", { type: "text/plain" });
  creditCardNumber = 0


  register()
  {

  }
}
<h2>Kutak dobre hrane</h2>


<div *ngIf="page == 1">
    Login<br>

    username: <input type="text" name="username" [(ngModel)]="username"><br>
    password: <input type="text" name="password" [(ngModel)]="password"><br>

    <button (click)="login()">Login</button><br>

    {{error}}

</div>


    <h4>Register</h4><br>

    Username: <input type="text" name="username" [(ngModel)]="username"><br>
    Password: <input type="text" name="password" [(ngModel)]="password"><br>

    Security question: <input type="text" name="securityQuestion" [(ngModel)]="securityQuestion"><br>
    Answer: <input type="text" name="securityAnswer" [(ngModel)]="securityAnswer"><br>

    forename: <input type="text" name="forename" [(ngModel)]="forename"><br>
    surname: <input type="text" name="surname" [(ngModel)]="surname"><br>

    Sex: <br>
    <input type="radio" value="M" [(ngModel)]="sex">M<br>
    <input type="radio" value="F" [(ngModel)]="sex">F<br><br>

    Address: <input type="text" name="address" [(ngModel)]="address"><br>
    Phone: <input type="tel" name="contactPhone" [(ngModel)]="contactPhone"><br>
    Email: <input type="email" name="email" [(ngModel)]="email"><br>
    Profile picture: <input type="file" name="profilePicure" [(ngModel)]="profilePicure"><br>
    Credit card number: <input type="number" name="creditCardNumber" [(ngModel)]="creditCardNumber"><br>

    <button (click)="register()">Register</button><br>

    {{error}}
